Here's a basic Rust app that uses the `reqwest` crate to make API requests to elevenlabs.io and the `tts` crate to read the contents of the clipboard aloud using text-to-speech.

First, add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.10"
tts = "0.1.0"
clipboard = "0.5.0"
```
Next, create a new file called `main.rs` and add the following code:
```rust
use reqwest;
use tts::{TTS, Voice};
use clipboard::{ClipboardContext, ClipboardEvent};

const ELEVENLABS_API_KEY: &str = "YOUR_API_KEY_HERE";
const ELEVENLABS_API_URL: &str = "https://api.elevenlabs.io/v1/text-to-speech";

#[tokio::main]
async fn main() -> Result<(), reqwest::Error> {
    // Initialize the clipboard context
    let mut clipboard = ClipboardContext::new().unwrap();

    // Set up the TTS engine
    let tts = TTS::new(Voice::English);

    // Define a callback function to handle clipboard events
    let callback = move |event: ClipboardEvent| {
        match event {
            ClipboardEvent::ClipboardChanged(text) => {
                // Make an API request to elevenlabs.io to get the audio data
                let client = reqwest::Client::new();
                let response = client
                    .post(ELEVENLABS_API_URL)
                    .header("Authorization", format!("Bearer {}", ELEVENLABS_API_KEY))
                    .header("Content-Type", "application/json")
                    .body(format!("{{ \"text\": \"{}\" }}", text))
                    .send()
                    .await
                    .unwrap();

                // Get the audio data from the response
                let audio_data = response.json::<serde_json::Value>().await.unwrap();

                // Play the audio data using the TTS engine
                tts.speak(audio_data["audio"].as_str().unwrap());
            }
            _ => {}
        }
    };

    // Start listening for clipboard events
    clipboard.add_listener(callback);

    // Run the event loop
    clipboard.run().await;

    Ok(())
}
```
This code sets up a clipboard listener that listens for changes to the clipboard contents. When the clipboard contents change, it makes an API request to elevenlabs.io to get the audio data for the text, and then plays the audio data using the TTS engine.

Note that you'll need to replace `YOUR_API_KEY_HERE` with your actual elevenlabs.io API key.

Also, this code uses the `tokio` runtime to run the event loop, so you'll need to add `tokio` to your `Cargo.toml` file as well:
```toml
[dependencies]
tokio = { version = "1", features = ["full"] }
```
